          if (onIncrement && !reverse) {
            onIncrement();
          } else if (onDecrement && reverse) {
            onDecrement();
          }
        }
        break;
      case 'Home':
        if (onDecrementToMin) {
          onDecrementToMin();
        }
        break;
      case 'End':
        if (onIncrementToMax) {
          onIncrementToMax();
        }
        break;
      case 'Enter':
        if (onCollapseToggle) {
          onCollapseToggle();
        }
        break;
    }
  };

  return {onMouseDown, onMouseEnter, onMouseOut, onKeyDown};
}

